  \"2016-07-27T22:52:40.119919\",\n\t\"name\": \"fy-1975-narrative-report-including-july-december-1975-squaw-creek-national-wildlife-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Squaw
  Creek NWR outlines Refuge accomplishments during the 1975 fiscal year. The report
  begins by summarizing the weather conditions and habitat conditions during the year.
  Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
  predators, fish, and reptiles- is also covered. The Refuge development and maintenance
  section discusses physical developments. Resource management is outlined; topics
  include grazing and fur harvesting. The public relations section of the report describes
  recreational uses. Items of interest are attached.\",\n\t\"license_title\": \"License
